import { Grid, Avatar, InputLabel, Input } from '@material-ui/core';
import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return ( 
        <Grid container position="row">
          <InputLabel style={{width:'300px'}}><Avatar style={{marginLeft:'20px'}} src={nikklaus}/> </InputLabel>
        <Input id="component-simple"/>
        </Grid>

 

);
}

export default Posts;
